import React from 'react';

function renderer(C){
    return <main><C /></main>
}

const Page = (P) => {
    let r = P.bind(null, {selectedRouteIndex: 0});
    let ret = () => <main><P /></main>
    //return( P.bind(null, {selectedRouteIndex: 0}))
    return renderer(P)
    return ret
}

export default Page;
